import profile from '../images/profile.JPG'
import './About.css'
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faGithub } from '@fortawesome/free-brands-svg-icons';
import { faLinkedin } from '@fortawesome/free-brands-svg-icons';
import { faGoogle } from '@fortawesome/free-brands-svg-icons';
import { faHandSparkles } from '@fortawesome/free-solid-svg-icons'
const About = () => {
    return (
        <>
            <div className="container-fluid mt-5">
                <div className="row">
                    <div className="col-6">
                        <h3 className='greet mb-3'>Hi all I'm Madhubala <FontAwesomeIcon icon={faHandSparkles} /></h3>
                        <p className='bio'>A passionate Full Stack Web Developer having an experience of building Web and Software Applications with JavaScript/ReactJs/Nodejs and some other cool libraries and frameworks.</p>
                        <h6><FontAwesomeIcon className='icon me-3' icon={faGithub} /> <FontAwesomeIcon className='icon me-3' icon={faLinkedin} /> <FontAwesomeIcon className='icon' icon={faGoogle} /></h6>
                    </div>
                    <div className="col-6">
                        <img src={profile} alt="profile pic" height="300px" width="550px"/>
                    </div>
                </div>
            </div>
        </>
    )
}
export default About;
